                    strFindStr = cb.Text + e.KeyChar;
                else
                    strFindStr = cb.Text.Substring(0, cb.SelectionStart) + e.KeyChar;
            }
            int intIdx = -1;
            
            intIdx = cb.FindString(strFindStr);
            if (intIdx != -1)
            {
                cb.SelectedText = "";
                cb.SelectedIndex = intIdx;
                cb.SelectionStart = strFindStr.Length;
                cb.SelectionLength = cb.Text.Length;
                e.Handled = true;
            }
            else
                e.Handled = true;
        }

        private void Calculate(object sender, EventArgs e)
        {
            txtStrategy.Clear();

            if (comboBJMulti.SelectedIndex != -1 && comboCurrentMulti.SelectedIndex != -1 && comboPlayer.SelectedIndex != -1 && comboDealer.SelectedIndex != -1)
            {
                int boardIndex = 12 * comboBJMulti.SelectedIndex + comboCurrentMulti.SelectedIndex;
                int dealerHandIndex = comboDealer.SelectedIndex + 1;
                int playerHandIndex = comboPlayer.SelectedIndex;
                string optimalStrategy = strategyBoards[boardIndex, playerHandIndex, dealerHandIndex];

                switch (optimalStrategy)
                {
                    case "H":
                        optimalStrategy = "Hit";
                        break;
                    case "S":
                        optimalStrategy = "Stand";
                        break;
                    case "P":
                        optimalStrategy = "Split";
                        break;
                    case "DH":
                        optimalStrategy = "Double otherwise Hit";
                        break;
                    case "DS":
                        optimalStrategy = "Double otherwise Stand";
                        break;
                }

                txtStrategy.Text = optimalStrategy;
            }
        }

        private void chkTopMost_CheckedChanged(object sender, EventArgs e)
        {
            TopMost = chkTopMost.Checked;
        }
    }
